,1)"},"line":{"color":"rgba(31,119,180,1)"},"xaxis":"x","yaxis":"y","frame":null}],"highlight":{"on":"plotly_click","persistent":false,"dynamic":false,"selectize":false,"opacityDim":0.2,"selected":{"opacity":1},"debounce":0},"shinyEvents":["plotly_hover","plotly_click","plotly_selected","plotly_relayout","plotly_brushed","plotly_brushing","plotly_clickannotation","plotly_doubleclick","plotly_deselect","plotly_afterplot"],"base_url":"https://plot.ly"},"evals":[],"jsHooks":{"render":[{"code":"// inspired, in part, by https://stackoverflow.com/a/48174836/1583084\nfunction(el) {\n  var tooltip = Plotly.d3.select('#' + el.id + ' .svg-container')\n    .append(\"div\")\n    .attr(\"class\", \"my-custom-tooltip\");\n\n  el.on('plotly_hover', function(d) {\n    var pt = d.points[0];\n    // Choose a location (on the data scale) to place the image\n    // Here I'm picking the top-left corner of the graph\n    var x = pt.xaxis.range[0];\n    var y = pt.yaxis.range[1];\n    // Transform the data scale to the pixel scale\n    var xPixel = pt.xaxis.l2p(x) + pt.xaxis._offset;\n    var yPixel = pt.yaxis.l2p(y) + pt.yaxis._offset;\n    // Insert the base64 encoded image\n    var img = \"<img src='\" +  pt.customdata + \"' width=100>\";\n    tooltip.html(img)\n      .style(\"position\", \"absolute\")\n      .style(\"left\", xPixel + \"px\")\n      .style(\"top\", yPixel + \"px\");\n    // Fade in the image\n    tooltip.transition()\n      .duration(300)\n      .style(\"opacity\", 1);\n  });\n\n  el.on('plotly_unhover', function(d) {\n    // Fade out the image\n    tooltip.transition()\n      .duration(500)\n      .style(\"opacity\", 0);\n  });\n}","data":null}]}}</script>
